export const  getProductById = (id) => {

    return new Promise((resolve, reject) => {

      setTimeout(() => {

        let product = products.find(product => parseInt(product.id) === parseInt(id))



        if (product) {

          resolve(product)

        } else {

          reject('El producto no existe')

        }

      }, 1000)

    })

  }
